import React from 'react'
import logo from '.../public/logo.png'
function Navbar() {
  return (
    <div className="flex flex-row justify-between">
    <img src="https://codehelp-shopping-cart.netlify.app/logo.png" width={450} height={250}/>
    <div>
      <p>Home</p>
      
    </div>
  </div>
  )
}

export default Navbar
